    points = []
    for i in range(N):
        x, y = map(int, stdin.split())
        points.append((x, y))

    # sort by X coordinate
    points.sort(key=lambda p: p[0])

    # sort by Y coordinate
    points.sort(key=lambda p: p[1])

    min_dist = 2 * D
    count = 0
    for i in range(N - 1):
        dist = abs(points[i][0] ** 2 + points[i][1] ** 2)
        if dist > D:
            continue
        for j in range(i + 1, N):
            dist = abs(points[i][0] ** 2 + points[j][1] ** 2)
            if dist > D:
                continue
            # if the distance between the two points is smaller than min_dist, update the min_dist
            if dist < min_dist:
                min_dist = dist
                count += 1
    return str(count)

