    data = stdin
    # get the number of black and white stones
    row_length = len(data)
    black_count = 0
    white_count = 0
    for i in range(row_length):
        if data[i] == 'B':
            black_count += 1
        if data[i] == 'W':
            white_count += 1

    # if the number of black stones are greater than white stones,
    # there is no need to put white stones and black stones
    if black_count > white_count:
        return '1'
    elif black_count < white_count:
        return '0'

    if black_count == white_count:
        # if the number of black stones are equal,
        # the order of placing white and black stones is not important
        # so we need to check which white stone should be placed
        # the condition is that if a white stone is placed, the black stones should be placed in the middle of the white stone
        white_index = black_count
        for i in range(row_length):
            if data[i] == 'W':
                white_index = i
                break

        # if white_index is not the last character,
        # we need to remove one white stone,
        # and then we need to remove one black stone
        if white_index!= row_length - 1:
            # the number of black stones to be removed is equal
            # to the length of the white stones to be removed
            black_count = row_length - white_index - 1
            return str(black_count)
        # else if white_index is the last character,
        # we need to remove one black stone,
        # and then we need to remove one white stone
        else:
            # the number of black stones to be removed is equal
            # to the length of the white stones to be removed
            black_count = row_length - white_index
            return str(black_count)

