        return x >= 0 and x < n and y >= 0 and y < m

    def is_adjacent(arr, x, y, n, m):
        for i in range(1, m):
            if is_valid(arr, x, y+i, n, m):
                if arr[x][y+i]!= '#':
                    return False
        for i in range(1, m):
            if is_valid(arr, x+i, y, n, m):
