                    return False
        for i in range(1, n):
            if is_valid(arr, x+i, y, n, m):
                if arr[x+i][y]!= '#':
                    return False
        return True

    def place(arr, x, y, n, m, visited, res):
        visited.add((x, y))
        if x == n-1 and y == m-1:
            res.append(arr[:])
            return
        if is_valid(arr, x, y, n, m):
            if (x, y) not in visited:
                place(arr, x, y, n, m, visited, res)
        visited.discard((x, y))

    res = []
    visited = set()
    for i in range(N):
        for j in range(M):
            if (i, j) not in visited:
                place(arr, i, j, N, M, visited, res)
